SELECT * FROM avaliacao;
SELECT * FROM alunos;
SELECT * FROM escolas;
SELECT * FROM gestores;
SELECT * FROM pea;

CREATE TABLE avaliacao (
  id SERIAL PRIMARY KEY,
  data_hora TIMESTAMP NOT NULL,
  email VARCHAR(255) NOT NULL,
  pontuacao INTEGER NOT NULL,
  unidade_escolar VARCHAR(255) NOT NULL,
  regiao_escola VARCHAR(255) NOT NULL,
  serie VARCHAR(255) NOT NULL,
  turma VARCHAR(255) NOT NULL,
  nome_completo_estudante VARCHAR(255) NOT NULL,
  estudante_com_deficiencia BOOLEAN NOT NULL,
  cartao_resposta_lingua_portuguesa JSONB NOT NULL
);
ALTER TABLE avaliacao
ADD cartao_resposta_matematica JSONB;

CREATE TABLE pea (
  id SERIAL PRIMARY KEY,
  ano NUMERIC(4) NOT NULL,
  serie VARCHAR(255) NOT NULL,
  turma VARCHAR(255) NOT NULL,
  disciplina VARCHAR(255) NOT NULL,
  questao NUMERIC(2) NOT NULL,
  nivel VARCHAR(255) NOT NULL,
  descritores VARCHAR(255),
  alternativas VARCHAR(255)
);

for (const data of json.data.disciplinas.LínguaPortuguesa) {
  INSERT INTO pea (
    ano,
    serie,
    turma,
    disciplina,
    questao,
    nivel,
    descritores,
    alternativas
  )
  VALUES (
    data.ano,
    data.serie,
    data.turma,
    data.disciplina,
    data.questao,
    data.nivel,
    data.descritores,
    data.alternativas
  );
}

for (const data of json.data.disciplinas.Matemática) {
  INSERT INTO pea (
    ano,
    serie,
    turma,
    disciplina,
    questao,
    nivel,
    descritores,
    alternativas
  )
  VALUES (
    data.ano,
    data.serie,
    data.turma,
    data.disciplina,
    data.questao,
    data.nivel,
    data.descritores,
    data.alternativas
  );
}


CREATE TABLE gestores (
  id SERIAL PRIMARY KEY,
  nome VARCHAR(255) NOT NULL,
  cpf VARCHAR(11) NOT NULL,
  escola VARCHAR(255) NOT NULL,
  funcao VARCHAR(255) NOT NULL,
  telefones TEXT NOT NULL
);

for (const data of json.gestores) {
  INSERT INTO gestores (
    nome,
    cpf,
    escola,
    funcao,
    telefones
  )
  VALUES (
    data.nome,
    data.cpf,
    data.escola,
    data.funcao,
    data.telefones.join(',')
  );
}

CREATE TABLE alunos (
  id SERIAL PRIMARY KEY,
  nome_completo VARCHAR(255) NOT NULL,
  matricula VARCHAR(255) NOT NULL,
  escola VARCHAR(255) NOT NULL,
  serie VARCHAR(255) NOT NULL,
  deficiencia VARCHAR(255)
);

CREATE TABLE escolas (
  id SERIAL PRIMARY KEY,
  nome_fantasia VARCHAR(255) NOT NULL,
  razao_social VARCHAR(255) NOT NULL,
  cnpj VARCHAR(20) NOT NULL,
  endereco VARCHAR(255) NOT NULL,
  contato VARCHAR(255) NOT NULL,
  responsavel_cnct VARCHAR(255) NOT NULL,
  tipo VARCHAR(255) NOT NULL
);

ALTER TABLE gestores
ALTER COLUMN cpf TYPE VARCHAR(14);

UPDATE gestores
SET nome = UPPER(nome),
    escola = UPPER(escola);

